import TodoList from "./TodoList"

/** @jsx Maverick.createElement */
function App() {
  return (
    <div className="todo-app">
      <TodoList />
    </div>
  )
}
const element = <App />
const container = document.getElementById("root")
Maverick.render(element, container)
